    def parse(self, response):
        for href in response.xpath(".//td[@nowrap]/a/@href"): # for loop for each item in single page
            # print(href.get())
            yield response.follow(href.get(), callback = self.parse_dir_contents)
    
    def parse_dir_contents(self, response):
        # table = response('td[id=cvedetails]')
        table = response.xpath('.//td[@id="cvedetails"]')
        for item in table:
            upper_table = item.xpath('.//table[@class="details"]')
            lower_table = item.xpath('.//table[@id="vulnprodstable"]')
            for i in range(2,1000):
                try:
                    yield{
                        # 'url': response.xpath(".//td[@nowrap]/a/@href"), # //div[@id='searchresults']/table[@class='searchresults sortable']/tr[@class='srrowns']/td[@nowrap]/a/@href
                        'cve': table.xpath('h1/a/text()').get(),
                        'severity': upper_table.xpath('.//tr/td/div[@class="cvssbox"]/text()').get(),
                        
                        'product_type': lower_table.xpath('tr')[i].xpath('normalize-space(td[2])').get(),
                        'vendor': lower_table.xpath('tr')[i].xpath('normalize-space(td[3])').get(),
                        'product': lower_table.xpath('tr')[i].xpath('normalize-space(td[4])').get()
                    }
                except:
                    None



















